<!DOCTYPE html>
<html>
<head>
<meta charset="utf-8"/>
<meta http-equiv="X-UA-Compatible" content="IE=edge"/>
<meta name="viewport" content="width=device-width, initial-scale=1.0">
<title>CG</title>
<link rel="stylesheet" type="text/css" id="applicationStylesheet" href="CG.css"/>
<script id="applicationScript" type="text/javascript" src="CG.js"></script>
</head>
<body>
<div id="CG">
	<img id="background" src="background.png" srcset="background.png 1x, background@2x.png 2x">
		
	<div id="MainContent">
		<svg class="background_l">
			<rect id="background_l" rx="0" ry="0" x="0" y="0" width="1602.89" height="716">
			</rect>
		</svg>
		<div id="n_CG">
			<span>工事中　CG</span>
		</div>
	</div>
	<div id="Header" class="Header">
		<svg class="HeaderBackground">
			<rect id="HeaderBackground" rx="8" ry="8" x="0" y="0" width="1799.845" height="100">
			</rect>
		</svg>
		<div onclick="application.goToTargetView(event)" id="Aboutme_Header" class="Aboutme_Header">
			<svg class="About">
				<rect id="About" rx="8" ry="8" x="0" y="0" width="359.226" height="70">
				</rect>
			</svg>
			<div id="About_me">
				<span>About me</span>
			</div>
		</div>
		<div id="CG_Header" class="CG_Header">
			<svg class="CG_t">
				<rect id="CG_t" rx="8" ry="8" x="0" y="0" width="359.226" height="70">
				</rect>
			</svg>
			<div id="Computer_Graphics">
				<span>Computer Graphics</span>
			</div>
		</div>
		<div onclick="application.goToTargetView(event)" id="Programming_Header" class="Programming_Header">
			<svg class="Programming">
				<rect id="Programming" rx="8" ry="8" x="0" y="0" width="359.226" height="70">
				</rect>
			</svg>
			<div id="Programming_x">
				<span>Programming</span>
			</div>
		</div>
		<div onclick="application.goToTargetView(event)" id="TopLogo" class="TopLogo">
			<img id="Top_Header" src="Top_Header.png" srcset="Top_Header.png 1x, Top_Header@2x.png 2x">
				
		</div>
	</div>
</div>
</body>
</html>
